        (3120, 542, 'ЦП:- 1 x Blazing pазъем M.2 (M2_1, Key M), Поддержка type 2280 PCIe Gen5x4 (128 Гб/с) mode*- 1 x Hyper pазъем M.2 (M2_2, Key M), Поддержка type 2260/2280 PCIe Gen4x4 (64 Гб/с) mode*Чипсет:- 4 x SATA3 6.0 Гб/с* Поддержка модулей NVMe SSD в качестве загрузочных дисков'),
