        (3122, 589, '- 1 x SPI TPM- 1 x Индикатор питания и разъем динамика- 1 x Разъем для подключения вентиляторов процессора (4-pin)*- 3 x Разъем вентилятора шасси / водяного насоса (4-pin) (Умный контроль скорости вентилятора)**- 1 x 24-контактный разъем питания ATX- 1 x 8-контактный разъем питания 12 В- 1 x Вывод аудио на переднюю панель корпуса- 2 x USB 2.0 (поддержка до четырех USB 2.0)- 1 x USB 3.2 Gen1 (поддержка до двух USB 3.2 Gen1)* CPU_FAN1 Поддержка the fan power до 1A (12W).** CHA_FAN1~3/WP support the fan power до 2A (24W).CHA_FAN1~3/WP определяются автоматически при установки вентиляторов с 3- или 4-пиновыми коннекторами.'),
