        (9052, 1744, '✅ Дизайн и размерУстройство сохранило привычную форму и размеры, а также динамический вырез фронтальной камеры "Dynamic Island". Из новых органов управления - настраиваемая физическая кнопка быстрых действий "Action Button" и отдельная сенсорная кнопка съемки "Camera Control", которая может быть использована не только в качестве спуска затвора камеры, но и для расширенных настроек съемки.✅ ЭкранiPhone 16 имеет яркий дисплей с разрешением 2556x1179 пикселей и яркостью до 2000 нит в пике, что обеспечивает четкое изображение даже при ярком солнечном свете.✅ПроцессорНовая модель оснащена системой на чипе Apple A18, разработанной специально для работы с генеративной моделью Apple Intelligence на самом устройстве. Apple A18 на 30% быстрее своего предшественника по CPU и на 40% быстрее по GPU.✅ КамерыБлок камер включает в себя два модуля: основной модуль на 48 Мп с оптической стабилизацией и кропом до 12 Мп, а также сверхширокоугольный 12 Мп модуль с режимом макро-съемки. Еще одним изменением является расположение самих камер. Теперь они расположены не по-диагонали, а симметрично друг другу. Это необходимо для съемки "пространственного" фото/видео, которое можно будет просматривать на фирменной MR-гарнитуре Apple VisionPro.✅ Беспроводная зарядкаНовые iPhone 16 получили улучшенную до 25 Вт мощность беспроводной зарядки через MagSafe и поддержку стандарта Qi2.✅ Apple IntelligenceСистема искуственного интеллекта, которая помогает вам писать, обрабатывать фото и выражать свои мысли добиваясь отличных результатов. Благодаря революционной защите конфиденциальности вы можете быть уверены в том, что никто другой не сможет получить доступ к вашим данным - даже Apple.✅ Обновленная при помощи ИИ SiriТеперь голосовой помощник ведет себя более естественно, контекстуально и индивидуально.*Изменения доступны только на английском языке.'),
