        (9419, 1744, '✅ Дизайн и размерiPhone 16 Pro оснащен увеличенным дисплеем, что полностью соответствует растущим потребностям в использовании смартфонов. При этом не стоит беспокоиться, что физически устройство станет значительно больше. Благодаря уменьшенным рамкам вокруг дисплея, его габариты почти не изменились по сравнению с iPhone 15 Pro.✅ ЭкранiPhone 16 Pro имеет яркий дисплей с разрешением 2622x1206 пикселей и яркостью до 2000 нит в пике, что обеспечивает четкое изображение даже при ярком солнечном свете.✅ПроцессорApple решила сделать серьёзный шаг вперёд, перейдя на второе поколение 3-нм технологии с использованием A18 Pro, что позволило значительно улучшить производительность как процессора, так и графики. Чип был специально разработан с учётом интеграции искусственного интеллекта. Это даёт 17%-ное увеличение общей пропускной способности памяти, что также положительно сказывается на работе 6-ядерного графического процессора, который работает до 20% быстрее по сравнению с прошлым поколением.✅ КамерыiPhone 16 Pro оснащён тремя камерами на задней панели, как и iPhone 15 Pro, но эти камеры не идентичны, и есть два значительных улучшения:- Во-первых, на этот раз у вас есть новая 5-кратная телеобъективная камера, которая заменила 3-кратный зум в 15 Pro. Это означает, что вы получите более чёткое изображение при 5X, 10X и большем увеличении, что особенно полезно при съёмке концертов или удалённых объектов.- Во-вторых, в ультраширокий объектив был установлен новый 48-мегапиксельный сенсор.- Что касается видеосъёмки, то новинка представляет собой поддержку 4K120. Ранее модели iPhone могли снимать в 120fps только при разрешении 1080p, что не так остро, как 4K. ✅ Беспроводная зарядкаНовые iPhone 16 Pro получили улучшенную до 25 Вт мощность беспроводной зарядки через MagSafe и поддержку стандарта Qi2.✅ Apple IntelligenceСистема искуственного интеллекта, которая помогает вам писать, обрабатывать фото и выражать свои мысли добиваясь отличных результатов. Благодаря революционной защите конфиденциальности вы можете быть уверены в том, что никто другой не сможет получить доступ к вашим данным - даже Apple.✅ Обновленная при помощи ИИ SiriТеперь голосовой помощник ведет себя более естественно, контекстуально и индивидуально.*Изменения доступны только на английском языке.'),
